metadata.content:
Grok Model
Configuration
The
```
grok
```
function accepts a model name string or a configuration object:
Copy Ask AI
```
const agent = createAgent ({
model: grok ({
model: "grok-4-latest" ,
apiKey: process . env . XAI_API_KEY ,
baseUrl: "https://api.x.ai/v1" ,
defaultParameters: { temperature: 0.5 },
}),
});
```
